import React from 'react'

const AxiosDelete = () => {

    const getData = () => {
        axios.get('https://jsonplaceholder.typicode.com/posts/1')
        .then((resp) => {
            console.log(resp.data)
        })
    }
  return (
    <div>
      <h2>Axios Delete Method</h2>
      <button>Delete</button>
    </div>
  )
}

export default AxiosDelete
